namespace RonSijm.FluidHumidifier.Factories.MediaTailor;

public class SourceLocationFactory(string resourceName = null, Action<Humidifier.MediaTailor.SourceLocation> factoryAction = null) : ResourceFactory<Humidifier.MediaTailor.SourceLocation>(resourceName)
{

    internal List<InnerSourceLocationSegmentDeliveryConfigurationFactory> SegmentDeliveryConfigurationsFactories { get; set; } = [];

    internal InnerSourceLocationDefaultSegmentDeliveryConfigurationFactory DefaultSegmentDeliveryConfigurationFactory { get; set; }

    internal InnerSourceLocationHttpConfigurationFactory HttpConfigurationFactory { get; set; }

    internal InnerSourceLocationAccessConfigurationFactory AccessConfigurationFactory { get; set; }

    protected override Humidifier.MediaTailor.SourceLocation Create()
    {
        var sourceLocationResult = CreateSourceLocation();
        factoryAction?.Invoke(sourceLocationResult);

        return sourceLocationResult;
    }

    private Humidifier.MediaTailor.SourceLocation CreateSourceLocation()
    {
        var sourceLocationResult = new Humidifier.MediaTailor.SourceLocation
        {
            GivenName = InputResourceName,
        };

        return sourceLocationResult;
    }
    public override void CreateChildren(Humidifier.MediaTailor.SourceLocation result)
    {
        base.CreateChildren(result);

        result.SegmentDeliveryConfigurations = SegmentDeliveryConfigurationsFactories.Any() ? SegmentDeliveryConfigurationsFactories.Select(x => x.Build()).ToList() : null;
        result.DefaultSegmentDeliveryConfiguration ??= DefaultSegmentDeliveryConfigurationFactory?.Build();
        result.HttpConfiguration ??= HttpConfigurationFactory?.Build();
        result.AccessConfiguration ??= AccessConfigurationFactory?.Build();
    }

} // End Of Class

